import React, {Component} from 'react';
import logo from './logo.svg'

class Logo extends Component {
    render() {
        return (
            <div className="logo-area">
                <a href="/"><img src={logo} alt="Legabiz Portal" /></a>
            </div>
        );
    }
}

export default Logo;
